import { BrowserRouter, Routes, Route } from 'react-router-dom';
import homepage from './homepage.jsx';

function App() {
  return (
    <Router>
      <Avatar />
      <Routes>
        <Route path="/" element={<homepage />} />
      </Routes>
    </Router>
  );
}

export default App;
